import { useAuth0 } from "@auth0/auth0-react";
import Bachg from "./Bachg";

function Login(){
  const { loginWithRedirect } = useAuth0();
   return(
    <>
    <Bachg/>
    <button onClick={() => loginWithRedirect()}>Log In</button>;
    </>

   )
};

export default Login;
